import React, { Component } from 'react';
import Header from '../components/Header';


class Home extends Component {
  render() {
    return (
      <div data-testid="page-search" className='bg-black text-white font-bold'>
        <aside className='p-4 font-semibold text-zinc-400 w-1/6 p-4 font-semibold text-zinc-400 bg-opacity-10 bg-white'>
          <nav className=' p-2 text-xs font-semibold '>
            <Header />

          </nav>
          <nav class="mt-10 pt-10 border-t border-zinc-800 flex flex-col gap-2 ">
            <a class="hover:text-zinc-100 text-sm hover:scale-110">Top Brasil</a>
            <a class="hover:text-zinc-100 text-sm hover:scale-110">Paredão Explode</a>
            <a class="hover:text-zinc-100 text-sm hover:scale-110">Nattan</a>
            <a class="hover:text-zinc-100 text-sm hover:scale-110">Funk Hits</a>
            <a class="hover:text-zinc-100 text-sm hover:scale-110">Pagodeira </a>

          </nav>

        </aside>


      </div>
    );
  }
}

export default Home;
